import React from "react";
import SearchBar from "./SearchBar";
import MovieList from "./MovieList";

class App extends React.Component {
    state = {
        movies: [
            {
                "id": 1,
                "name": "The Flash",
                "rating": 8.3,
                "overview": "Lorem LoremLorem LoremLorem LoremLorem",
                "imageURL": "https://www.themoviedb.org/t/p/w300_and_h450_bestv2/lJA2RCMfsWoskqlQhXPSLFQGXEJ.jpg"
            },
            {
                "id": 2,
                "name": "The Flash",
                "rating": 8.4,
                "overview": "Lorem LoremLorem LoremLorem LoremLorem",
                "imageURL": "https://www.themoviedb.org/t/p/w300_and_h450_bestv2/lJA2RCMfsWoskqlQhXPSLFQGXEJ.jpg"
            },
            {
                "id": 3,
                "name": "The Flash",
                "rating": 8.4,
                "overview": "Lorem LoremLorem LoremLorem LoremLorem",
                "imageURL": "https://www.themoviedb.org/t/p/w300_and_h450_bestv2/lJA2RCMfsWoskqlQhXPSLFQGXEJ.jpg"
            }
        ]
    }

    render() {
        return (
            <div className="container">
                <div className="row">
                    <div className="col-lg-12">
                    </div>
                </div>
                <MovieList
                    movies={this.movies} />
            </div>
        )
    }
}

export default App;
